import React, { Dispatch, SetStateAction, useEffect, useRef, useState } from "react";
import { AuthService } from "../api/AuthService";
import { useNavigate } from "react-router-dom";
import { useUser } from "../context/UserContext";
import DiffieHellmanService from "../api/DiffieHellmanService";
import Button from "../components/Button";
import { iconsRef } from "../utils/iconsRef";
import { useMessenger } from "../context/MessengerContext";

const Login: React.FC = () => {
  const navigate = useNavigate();
  const [showInfoModal, setShowInfoModal] = useState(false);
  const { setUser } = useUser();

  const handleLogin = async (e: React.FormEvent) => {
    e.preventDefault();
    try {
      const credentials = await AuthService.enterPool();
      const { publicKey, secret } = DiffieHellmanService.handleGenerateKeys();
      setUser({ jwt: credentials.token, nickname: credentials.nickname, publicKey, secretKey: String(secret) });
      navigate("/messenger");
    } catch (error) {
      console.error("Login failed:", error);
      alert("Login failed. No response from server.");
    }
  };

  return (
    <Body>
      <LoginWindow handleLogin={handleLogin} setState={setShowInfoModal} state={showInfoModal} />
    </Body>
  );
};

export default Login;

const LoginWindow = ({ handleLogin, setState, state }: { handleLogin: (e: React.FormEvent) => void, setState: Dispatch<SetStateAction<boolean>>, state: boolean }) => {
  return (
    <WhiteFrame>
      <div className="flex flex-row justify-center items-center pb-40">
        <h2 className="text-2xl font-semibold text-center">PrivChat</h2>
        <Icon icon={iconsRef.info} setState={setState} />
      </div>
      {state && <InfoModal />}
      <Button text={"Enter Pool"} onClick={handleLogin} />
    </WhiteFrame>
  );
};

const WhiteFrame = ({ children }: { children: React.ReactNode }) => {
  return (
    <div className="flex flex-col justify-between p-20 bg-white min-h-[200px] rounded-xl">
      {children}
    </div>
  );
};

const Body = ({ children }: { children: React.ReactNode }) => {
  return (
    <div className="flex items-center justify-center min-h-screen min-w-screen bg-gray-200">
      {children}
    </div>
  );
};

const Icon = ({ icon, setState }: { icon: string, setState: (state: boolean) => void }) => {
  const width = 40;
  const height = 40;
  const iconRef = useRef<HTMLImageElement>(null);
  const { setInfoIconRef } = useMessenger();

  useEffect(() => {
    if (iconRef.current) {
      setInfoIconRef(iconRef);
    }
  }, [setInfoIconRef]);

  return (
    <img
      ref={iconRef}
      src={icon}
      width={width}
      height={height}
      onMouseEnter={() => setState(true)}
      onMouseLeave={() => setState(false)}
    />
  );
};

const InfoModal = () => {
  const { infoIconRef } = useMessenger();

  // Ensure the ref is set before calling getBoundingClientRect
  const [iconPosition, setIconPosition] = useState<{ top: number; left: number } | null>(null);

  useEffect(() => {
    if (infoIconRef.current) {
      const { top, left } = infoIconRef.current.getBoundingClientRect();
      setIconPosition({ top, left });
    }
  }, [infoIconRef]);

  if (!iconPosition) {
    return null; // Don't render the modal if the icon position is not available
  }

  return (
    <>

        <div
        className="p-4 bg-gray-100 max-w-[200px] absolute rounded-l shadow-xl"
        style={{
          top: iconPosition.top + 40, // Adjust the `40` value to place the modal just below the icon
          left: iconPosition.left - 40,
        }}
      >
        <ArrowUp/>      

        <p>Here is the information about the application. Use end-to-end encryption without registration.</p>
      </div>
    </>

  );
};
const ArrowUp = () => {
  const styles = {
    width: 0,
    height: 0,
    borderLeft: '10px solid transparent',
    borderRight: '10px solid transparent',
    borderBottom: '10px solid black',
  };

  return <div style={styles} />;
};
